import { StyleSheet } from "react-native"

const styles = StyleSheet.create({
    containerSearch: {
       flexDireaction: 'row',
       backgroundColor: 'white',
       width: '90%',
       marginTop: 30,
       alignItems: 'center',
       borderRadius: 3,  
    },
    inputSearch: {
        height: 35,
        width: '100%',
        marginLeft: 5,
    }

})


export default styles
